import React from 'react';
import './App.css';
import HeaderComponent from './components/header.component';

function App() {
  return (
    <React.Fragment>
      <HeaderComponent>
        <div className="login_form">

        <input type = "text" id="username" name="user"></input>
        </div>
      </HeaderComponent>
    </React.Fragment>
  );
}

export default App;
